    public static boolean testBiomes(){
        OverworldBiomeSource overworldBiomeSource = new OverworldBiomeSource(MCVersion.v1_12, 541515181818L);
        int size=16;
        for (int i = 0; i < size; i++) {
            for (int j = 0; j < size; j++){
                int x=biomes[i*size+j][0];
                int z=biomes[i*size+j][1];
                int id=overworldBiomeSource.biomes.sample(x,0,z);
                if (id!=biomes[i*size+j][2]) {
                    System.out.println(i+" "+j+" Wrong got id "+id+" but was "+biomes[i*size+j][2]);
                    return false;
                }
            }
        }
        return true;
    }

